import SignIn from "./SignIn/SignIn";
import SignUp from "./SignUp/SignUp";
import SideBar from "./MainPage/SideBar";
import SubCategories from "./SubCategories/SubCategories";
import ProductDetails01 from "./ProductDetails01/ProductDetails01";
import PlaceAd from "./PlaceAd/PlaceAd";
import AllAd from "./AllAd/AllAd";
import ActiveAd from "./ActiveAd/ActiveAd";
import Bids from "./Bids/Bids";
import ExpiredAd from "./ExpiredAd/ExpiredAd";
import SoldAd from "./SoldAd/SoldAd";
import Payment from "./Payments/Payments";
import Settings from "./Settings/Settings";
import Chat from "./Chat/Chat";
import SavedAds from "./SavedAds/SavedAds";
import SavedSearches from "./SavedSearches/SavedSearches";

function App() {
  const [scrollToContent, contentRef] = useScroll()

  return (
    <div className="box-border">

      <Introduction/>


      <Header />
      <ByeAndSell/>
      <SideBar/>
      <SignIn/>
      <SignUp/>
      <SubCategories/>
      <ProductDetails01/>
      <PlaceAd/>
      <AllAd/>
      <ActiveAd/>
      <ExpiredAd/>
      <Bids/>
      <SoldAd/>
      <Payment/>
      <Settings/>
      <Chat/>
      <SavedAds/>
      <SavedSearches/>









      <Footer/>






    </div>
  );
}

export default App;
